g2:c.PROCEDURE.g2:a.TEXT:
test-get-interface(a-object : item-or-value )

    iorvInterface : item-or-value ;
begin

        iorvInterface = call gdsm-network-pool-get-an-interface  (test-database-interface-instance , a-object ) ;

        repeat
          exit if not(test-interface-wait);
          wait for 0.1;
        end;

        call gdsm-network-pool-release-an-interface(test-database-interface-instance , iorvInterface);
end

show-status-and-utilization () = ( integer ) 
i : integer; 
ifss : sequence;
stru: structure; 
last-status : value;
current-utilization : integer;
sum-of-current-utilizations : integer;
begin
  ifss = the _network-interfaces of test-database-interface-instance ;
  sum-of-current-utilizations = 0;  
  for i = 1 to 2 do
    stru = ifss[i - 1];
    current-utilization = the current-utilization of stru;
    last-status = the last-status of stru;
    post "interface [i]: Utilization = [current-utilization], Status = [last-status]";
    sum-of-current-utilizations = sum-of-current-utilizations + current-utilization;
  end;  
  return sum-of-current-utilizations;
end

do-all-test (node: class benchmark-node)
tdii : class test-database-interface;
result : truth-value; message : text; 
begin
  tdii = test-database-interface-instance;
  result, message = call start-test-database-interface-and-wait-for-its-initialization();
  if not (result) then 
    call fail(node,message);
  result, message = call acquire-interface-object-1-several-times-and-release-it(2);
  if not (result) then
    call fail(node,message);
 result, message = call acquire-both-objects-several-times-and-release-them();  
  if not (result) then 
    call fail(node,message); 
  call gdsm-network-pool-cleanup(tdii);
  call pass(node);
end

start-test-database-interface-and-wait-for-its-initialization () = ( truth-value, text )
ifss : sequence;
stru: structure; 
last-status : value;
current-utilization : value; 
value-of-_network-interfaces : value; 
no-of-network-interfaces : integer;
no-of-initialized-interfaces : integer;
i : integer;
network-interface : structure;
initialization-successful : truth-value;
tdii : class test-database-interface;
begin
initialization-successful = false;
tdii = test-database-interface-instance;
start gdsm-network-pool-initialize(tdii);

// wait for interface to start
repeat
  value-of-_network-interfaces = the _network-interfaces of tdii;
  if (value-of-_network-interfaces is a sequence) then
    no-of-network-interfaces = the number of elements in value-of-_network-interfaces;
    no-of-initialized-interfaces = 0;
    for network-interface = each structure in value-of-_network-interfaces do
      begin
      if the last-status of network-interface = the symbol connected then
        no-of-initialized-interfaces = no-of-initialized-interfaces + 1;
      end;
      if no-of-initialized-interfaces = no-of-network-interfaces and no-of-network-interfaces > 0 then
        initialization-successful = true;
    end;
  exit if initialization-successful;
  post "Waiting for interfaces to be connected";
  wait for 5 seconds;
  end;
post "All interfaces are connected";
return true, "";
end

acquire-interface-object-1-several-times-and-release-it (n : integer) = (truth-value, text)
current-utilization : integer;
i : integer;
begin
conclude that test-interface-wait = true;
for i = 1 to n do 
  start test-get-interface (an-object-1);
  wait for 2 second;
  current-utilization = call show-status-and-utilization();
  if current-utilization /= 1 then
    return false, "After [i] initializations of the object, unexpected current-utilization [current-utilization]";
  end;
conclude that test-interface-wait = false; 
wait for n;
current-utilization = call show-status-and-utilization();
if current-utilization /= 0 then
  return false, "After releasing an object, unexpected utilization [current-utilization]";
return true,"";
end

acquire-both-objects-several-times-and-release-them () = (truth-value, text)
current-utilization : integer;
i : integer;
begin
  conclude that test-interface-wait = true;

  start test-get-interface (an-object-1);
  wait for 1 second;
  current-utilization = call show-status-and-utilization();
  if current-utilization /= 1 then
    return false,  "After first initialization of interface-object-1, unexpected current-utilization [current-utilization]";
  
  start test-get-interface (an-object-2);
  wait for 1 second;
  current-utilization = call show-status-and-utilization();
  if current-utilization /= 2 then
    return false,  "After first initialization of interface-object-2, unexpected current-utilization [current-utilization]";

  start test-get-interface (an-object-1);
  wait for 1 second;
  current-utilization = call show-status-and-utilization();
  if current-utilization /= 2 then
    return false,  "After subsequent initialization of interface-object-1, unexpected current-utilization [current-utilization]";
  
  start test-get-interface (an-object-2);
  wait for 1 second;
  current-utilization = call show-status-and-utilization();
  if current-utilization /= 2 then
    return false,  "After subsequent initialization of interface-object-2, unexpected current-utilization [current-utilization]";  
  
conclude that test-interface-wait = false; 
wait for 1 second;

current-utilization = call show-status-and-utilization();
if current-utilization /= 0 then
  return false,  "After releasing an object, unexpected utilization [current-utilization]";
return true,"";
end
